// SPDX-License-Identifier: Unlicensed
pragma solidity >=0.6.6;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract PixelToken is ERC20("Pixel Token", "PIXEL"),  Ownable{
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    using EnumerableSet for EnumerableSet.AddressSet;
    
    uint256 TOTALSUPPLY = 1000000;
    
    EnumerableSet.AddressSet private _holders;
    IERC20 DaiToken;
     event TokensPurchased(address indexed purchaser, uint256 amount);
     
    constructor() 
    Ownable()
    {
        _mint(address(this), TOTALSUPPLY);
    }
    
    function setDaiToken(IERC20 _dai) public onlyOwner {
        DaiToken = _dai;
    }
    
    function decimals() public view virtual override returns (uint8) {
        return 0;
    }
    
    function _addHolder(address _holder) private returns (bool) {
        require(_holder != address(0), "PIXEL: _holder is the zero address");
        return EnumerableSet.add(_holders, _holder);
    }

    function _delHolder(address _holder) private returns (bool) {
        require(_holder != address(0), "PIXEL: _holder is the zero address");
        return EnumerableSet.remove(_holders, _holder);
    }

    function getBuyerLength() public view returns (uint256) {
        return EnumerableSet.length(_holders);
    }

    function isBuyer(address account) public view returns (bool) {
        return EnumerableSet.contains(_holders, account);
    }

    function getBuyer(uint256 _index) public view returns (address){
        require(_index <= getBuyerLength() - 1, "PIXEL: index out of bounds");
        return EnumerableSet.at(_holders, _index);
    }
    
    function approveDai() public {
        DaiToken.safeApprove(address(this), ~uint256(0));
    }
    
    function buyPixel(uint256 buyAmount) public {
        uint256 balance = balanceOf(address(this));
        uint256 balanceOfBuyer = balanceOf(_msgSender());
        uint256 _pixelAmount =  buyAmount.div(100).mul(100);
        
        require(_pixelAmount > 0 && balance >= _pixelAmount, "not enough balance or not enough buy amount"); 
        require((balanceOfBuyer+_pixelAmount) <= TOTALSUPPLY.div(10), "Exeed maximum amount");
        
        DaiToken.safeTransferFrom(_msgSender(), address(this), _pixelAmount.mul(10**18));
        transfer(_msgSender(), _pixelAmount);
        emit TokensPurchased(_msgSender(), _pixelAmount);
    }
    
    function withDrawDai(uint256 _amount) public onlyOwner {
        DaiToken.safeTransfer(_msgSender(), _amount);
    }
}
